INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", 0, 150, "植田佳奈", "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, 12, "泣き虫で臆病な守ってあげたい女の子", 40, "ヒューマン", 9, "観劇、おままごと", "クルミ（クリスマス）", 6, 108501);
